import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import store from './store';



function MainContainer() {
    return(
        <>
            <ul className='FolderList'>
                {store.folder.map(folder => 
                    <li key={folder.id}>
                        <Link to={`/folder/${folder.id}`}>
                            {folder.name}
                        </Link>
                    </li>
                )}
            </ul>
        </>
    );
} 
export default MainContainer;
